The code you provided is using Laravel's Eloquent ORM to retrieve an array of employee data. The `toArray()` method at the end converts the resulting object into an associative array.

To remove commas from the output, in this case, (assuming the `fname`, `name`, and `mname` fields contain strings with commas), you can use the `str_replace` PHP function or the `replace` method on the resulting array.

Here are two possible solutions:

**Method 1: Using `str_replace`**
```php
$employeeData = Employee::select(['fname', 'name','mname'])
    ->where('id', $record->id)
    ->first()
    ->toArray();

// Remove commas from each value in the array
foreach ($employeeData as &$value) {
    $value = str_replace(',', '', $value);
}
```
**Method 2: Using `array_map` and `str_replace`**
```php
$employeeData = Employee::select(['fname', 'name','mname'])
    ->where('id', $record->id)
    ->first()
    ->toArray();

// Remove commas from each value in the array
$employeeData = array_map(function ($value) {
    return str_replace(',', '', $value);
}, $employeeData);
```
In both examples, (Method 1 and Method 2), we're iterating over the resulting array and using `str_replace` to remove commas (``,` `) from each string value.

After applying one of these methods, your `$employeeData` array should have commas removed from the values.

Please note that if you want to remove commas only from specific columns (e.g., `fname` and `name`, but not `mname`), you'll need to modify the logic accordingly.assistant

