The simplest way to remove commas from the output would be to use `str_replace` directly within the closure passed to the `select` method.

Here's how you could do it:
```php
$employeeData = Employee::select([
    DB::raw("REPLACE(fname, ',', '') as fname"),
    DB::raw("REPLACE(name, ',', '') as name"),
    DB::raw("REPLACE(mname, ',', '') as mname")
])->where('id', $record->id)->first()->toArray();
```
This will perform the comma replacement operation within the database query itself, so the result array won't contain any commas.

